import React, {useState} from 'react';
import {
  createMuiTheme
} from '@material-ui/core/styles';
import './App.css';
import red from '@material-ui/core/colors/red';

import './App.css';

class App extends React.Component{

  readonly theme = createMuiTheme({
    palette: {
      primary: {
        main: red[600]
      },
      background: {
        default: red[100]
      }
    }
  });

  render() {
    return (
      <div className="LoginPage">
        <div style={{
          backgroundColor: this.theme.palette.background.default,
          minHeight: window.innerHeight
        }}>
        <h3 style={{marginTop: '-128px', marginLeft: '150px'}}>Username:</h3>
        <h3 style={{}}>Password</h3>
        </div>
      </div>
    );
  }
}

export default App;
